void MoveSubUnitUpList (LONG iUnit, LONG iStartUnit)
{
	LONG	i, iNext, iPrev, n, j;

	if (iUnit == iStartUnit) return;

	for (i=iStartUnit, iNext=units[iStartUnit].NextUnit, iPrev=-1;
			iNext!=iUnit && iNext!=-1;
				iPrev=i, i=iNext, iNext=units[i].NextUnit) ;

	//if (iPrev == -1)
	//	printf("MoveSubUnitUpList - before [--(-)->--] [%d(%d)->%d] [%d(%d)->%d]\n",
	//		i,units[i].Joined,units[i].NextUnit,
	//		iNext,units[iNext].Joined,units[iNext].NextUnit);
	//else
	//	printf("MoveSubUnitUpList - before [%d(%d)->%d] [%d(%d)->%d] [%d(%d)->%d]\n",
	//		iPrev,units[iPrev].Joined,units[iPrev].NextUnit,
	//		i,units[i].Joined,units[i].NextUnit,
	//		iNext,units[iNext].Joined,units[iNext].NextUnit);

	if (iNext == -1) return;

	if (iPrev == -1)
	{
		SetGameData(MP_UNITS, MPUNITS_JOINED, i, TRUE, TRUE );
		
		SetGameData(MP_UNITS, MPUNITS_JOINED,      iNext, FALSE, FALSE );
		SetGameData(MP_UNITS, MPUNITS_NOTSPOTTED,  iNext, units[i].NotSpotted, FALSE );
		SetGameData(MP_UNITS, MPUNITS_PROVINCE,    iNext, units[i].province, FALSE );
		SetGameData(MP_UNITS, MPUNITS_REALM,       iNext, units[i].Realm, FALSE );
		SetGameData(MP_UNITS, MPUNITS_BLESSED,     iNext, units[i].Blessed, FALSE );
		SetGameData(MP_UNITS, MPUNITS_MOVEPART,    iNext, units[i].MovePart, FALSE);
		SetGameData(MP_UNITS, MPUNITS_DESTPROVINCE,iNext, units[i].DestProvince, FALSE);
		SetGameData(MP_UNITS, MPUNITS_DESTPATH1,   iNext, units[i].DestPath1, FALSE);
		SetGameData(MP_UNITS, MPUNITS_DESTPATH2,   iNext, units[i].DestPath2, FALSE);
		SetGameData(MP_UNITS, MPUNITS_DESTPATH3,   iNext, units[i].DestPath3, FALSE);
		
		#ifdef _WINDOWS
		if (IsMultiPlayer())
			AMultiPlayer.UnitMessage(iNext, (UBYTE *)&units[iNext], "UP LIST");
		#endif
		
		iSelectedUnit = iNext;
	}
	else
		//units[iPrev].NextUnit = iNext;
		SetGameData(MP_UNITS, MPUNITS_NEXTUNIT, iPrev, iNext, TRUE );

	SetGameData(MP_UNITS, MPUNITS_NEXTUNIT, i, units[iNext].NextUnit, TRUE );
	SetGameData(MP_UNITS, MPUNITS_NEXTUNIT, iNext, i, TRUE );


	//if (iPrev == -1)
	//	printf("MoveSubUnitUpList - before [--(-)->--] [%d(%d)->%d] [%d(%d)->%d]\n",
	//		iNext,units[iNext].Joined,units[iNext].NextUnit,
	//		i,units[i].Joined,units[i].NextUnit);
	//else
	//	printf("MoveSubUnitUpList - after [%d(%d)->%d] [%d(%d)->%d] [%d(%d)->%d]\n",
	//		iPrev,units[iPrev].Joined,units[iPrev].NextUnit,
	//		iNext,units[iNext].Joined,units[iNext].NextUnit,
	//		i,units[i].Joined,units[i].NextUnit);

	fRedrawAll = TRUE;
}
/* ========================================================================
   Function    - CreateUnit
   Description - Find a unit index and set up the default data state.
   Returns     - the Unit Index
   ======================================================================== */
LONG CreateUnit (PROVINCE prov, MAP_ICON icon, LONG id, REALM::REALM_TYPE realm, BOOL fSend )
{
	return CreateUnitNJ (prov, icon, id, realm, fSend, TRUE);
}
/* ========================================================================
   Function    - CreateUnitNJ
   Description - Find a unit index and set up the default data state.
   Returns     - the Unit Index
   ======================================================================== */
LONG CreateUnitNJ (PROVINCE prov, MAP_ICON icon, LONG id, REALM::REALM_TYPE realm, BOOL fSend, BOOL fJoin )
{
	LONG	j=1;
	LONG	i;
	LONG	f = FALSE;

	RequestUnitsIndex(&j, fSend);

	if (j >= MAX_UNITS)
	{
//		fatal_error("ERROR - exceeded MAX_UNITS while creating unit in ACTNMENU\n");
		return fERROR;
	}

	SetGameData(MP_UNITS, MPUNITS_PROVINCE, j, prov, FALSE );
	SetGameData(MP_UNITS, MPUNITS_REALM, j, realm, FALSE );
	SetGameData(MP_UNITS, MPUNITS_ICON, j, icon, FALSE );
	SetGameData(MP_UNITS, MPUNITS_MOVING, j, FALSE, FALSE );
	SetGameData(MP_UNITS, MPUNITS_AVOIDMOVE, j, FALSE, FALSE );
	SetGameData(MP_UNITS, MPUNITS_JOINED, j, FALSE, FALSE );
	SetGameData(MP_UNITS, MPUNITS_NOTSPOTTED, j, TRUE, FALSE );
	SetGameData(MP_UNITS, MPUNITS_DISGUISED, j, FALSE, FALSE );
	SetGameData(MP_UNITS, MPUNITS_HASTENED, j, FALSE, FALSE );
	SetGameData(MP_UNITS, MPUNITS_BLESSED, j, FALSE, FALSE );
	SetGameData(MP_UNITS, MPUNITS_PAID, j, TRUE, FALSE );
	SetGameData(MP_UNITS, MPUNITS_USE_REGENCY, j, FALSE, FALSE );
	SetGameData(MP_UNITS, MPUNITS_DESTPROVINCE, j, NO_PROVINCE, FALSE );
	SetGameData(MP_UNITS, MPUNITS_MOVEPART, j, 0, FALSE );
	SetGameData(MP_UNITS, MPUNITS_ID, j, (id == 0)? UnitTypeID[icon]:id, FALSE );
	SetGameData(MP_UNITS, MPUNITS_NEXTUNIT, j, -1, FALSE );
	SetGameData(MP_UNITS, MPUNITS_IICONBITM, j, units[j].Icon, FALSE );

	#ifdef _WINDOWS
	if (fSend && IsMultiPlayer())
		AMultiPlayer.UnitMessage(j, (UBYTE *)&units[j], "CREATE UNIT");
	#endif
	
// DONT TRANSMIT TO OTHER PLAYERS - DONT TRANSMIT TO OTHER PLAYERS
// ONLY CHANGE LOCAL - ONLY CHANGE LOCAL - ONLY CHANGE LOCAL ARRAYS
	// check for spotting units
	units[j].NotSpotted = TRUE;
	if (icon == A_SCT_UNIT_ICON)
	{
		PROVINCE	thisProv = prov;
		PROVINCE	nextProv;
		LONG		k;
		
		if(CanISeeAnyoneInThisProv(HomeRealm, thisProv))
		{
			MarkUnitsSpotted(nextProv);
			units[j].NotSpotted = FALSE;
		}
		
		for(k=0;k<7;k++)
		{
			nextProv = (PROVINCE)province[thisProv].Border[k].Province;
			if(CanISeeAnyoneInThisProv(HomeRealm, nextProv))
			{
				MarkUnitsSpotted(nextProv);
				units[j].NotSpotted = FALSE;
			}
		}
	}
	else
	if (CanISeeAnyoneInThisProv(HomeRealm, prov))
	{
		MarkUnitsSpotted(prov);
		units[j].NotSpotted = FALSE;
	}
// ONLY CHANGE LOCAL - ONLY CHANGE LOCAL - ONLY CHANGE LOCAL ARRAYS
// DONT TRANSMIT TO OTHER PLAYERS - DONT TRANSMIT TO OTHER PLAYERS

	// check joining units
	if ( fJoin )
	{
		for (i=1; i<MAX_UNITS; ++i)		// scan for units here
		{
			if (i!=j 								// not self
				&& units[i].Joined == FALSE			// leader
				&& units[i].province == prov		// in this prov
				&& units[i].Realm == realm			// same realm
				&& units[j].DestProvince == NO_PROVINCE	// Not moving.
				&& CountUnitStack(i) < gUnitStackSize )
			{
				LONG k = i;
				while (units[k].NextUnit != -1)		// find last unit in the stack
					k = units[k].NextUnit;
				SetGameData(MP_UNITS, MPUNITS_NEXTUNIT, k, j, fSend );
				SetGameData(MP_UNITS, MPUNITS_JOINED, j, TRUE, fSend );
				SetGameData(MP_UNITS, MPUNITS_PROVINCE, j, NO_PROVINCE, fSend );
				break;
			}
		}
	}

	//++cntUnits;
	return j;
}


/* ========================================================================
   Function    - RequestUnitsIndex
   Description - 
   Returns     - 
   ======================================================================== */
void RequestUnitsIndex (LONG *index, BOOL fSend)
{
	LONG	j = 1;

#ifdef _WINDOWS
	// if we are the master or a single player game or an NPC
	if ((IsMultiPlayer() && AMultiPlayer.IsMaster()) || !IsMultiPlayer() || fSend==FALSE)
	{
		while ( j < MAX_UNITS && units[j].Realm != REALM::NO_COUNTRY )
			++j;

		if (j < MAX_UNITS)							// mark this as allocated
			units[j].Realm = REALM::MIERES;		// just != REALM::NO_COUNTRY

		*index = j;
	}

	else
	// slave in a multiplayer game
	{
		j = GetGameData(MP_GAMEDATA, MPGAMESEMIPHORE_UNITINDEX, 0);
		*index = j;
	}

#else
	// single player game
	while ( j < MAX_UNITS && units[j].Realm != REALM::NO_COUNTRY )
		++j;
	*index = j;
#endif

	LOGCOMMENTSLEEP
	if ( fLogComment )
	{
		char temp[100];
		sprintf ( temp, "   units.cpp RequestUnitsIndex - index:%ld fSend:%ld", j, fSend);
		RandomLogComment ( temp );
	}

}


/* ========================================================================
   Function    - UnitFinalProvince
   Description - Trace through the list of destination provinces
   Returns     - The last valid province.
   ======================================================================== */
PROVINCE UnitFinalProvince (LONG i)
{
	PROVINCE unit_test_prov;

	unit_test_prov = (PROVINCE) units[i].province;
	if (units[i].DestProvince)
	{
		unit_test_prov = (PROVINCE) units[i].DestProvince;
		if (units[i].DestPath1)
		{
			unit_test_prov = (PROVINCE) province[unit_test_prov].Border[(units[i].DestPath1-1)&0x7].Province;
			if (units[i].DestPath2)
			{
				unit_test_prov = (PROVINCE) province[unit_test_prov].Border[(units[i].DestPath2-1)&0x7].Province;
				if (units[i].DestPath3)
					unit_test_prov = (PROVINCE) province[unit_test_prov].Border[(units[i].DestPath3-1)&0x7].Province;
			}
		}
	}

	return unit_test_prov;
}

