/* ========================================================================
   Function    - TransportUnit
   Description - Move a unit from this stack to another province.
   Returns     -
   ======================================================================== */
void TransportUnit(LONG iUnit, PROVINCE prov, BOOL fSend)
{
	LONG	k;
	// not joined means this is a leader or single unit
	// handle the troops remained in the old province
	if (units[iUnit].Joined == FALSE)
	{
		k = units[iUnit].NextUnit;
		if (k != -1)							// if we HAVE followers
		{
			// Update all the data which is only kept up-to-date in the leader.
			SetGameData(MP_UNITS, MPUNITS_JOINED,      k, FALSE, FALSE );
			SetGameData(MP_UNITS, MPUNITS_NOTSPOTTED,  k, units[iUnit].NotSpotted, FALSE );
			SetGameData(MP_UNITS, MPUNITS_PROVINCE,    k, units[iUnit].province, FALSE );
			SetGameData(MP_UNITS, MPUNITS_REALM,       k, units[iUnit].Realm, FALSE );
			SetGameData(MP_UNITS, MPUNITS_DISGUISED,   k, units[iUnit].Disguised, FALSE );
			SetGameData(MP_UNITS, MPUNITS_MOVING,      k, units[iUnit].Moving, FALSE );
			SetGameData(MP_UNITS, MPUNITS_AVOIDMOVE,   k, units[iUnit].AvoidMove, FALSE );
			SetGameData(MP_UNITS, MPUNITS_MOVEPART,    k, units[iUnit].MovePart, FALSE );
			SetGameData(MP_UNITS, MPUNITS_DESTPROVINCE,k, units[iUnit].DestProvince, FALSE);
			SetGameData(MP_UNITS, MPUNITS_DESTPATH1,   k, units[iUnit].DestPath1, FALSE);
			SetGameData(MP_UNITS, MPUNITS_DESTPATH2,   k, units[iUnit].DestPath2, FALSE);
			SetGameData(MP_UNITS, MPUNITS_DESTPATH3,   k, units[iUnit].DestPath3, FALSE);
			#ifdef _WINDOWS
			if (fSend && IsMultiPlayer())
				AMultiPlayer.UnitMessage(k, (UBYTE *)&units[k], "TRANSPORT");
			#endif
			CheckLeader(k, fSend );					// put best leader on top
		}
	}

	else		// unit is a follower
	{
		for (k=1; k<MAX_UNITS; k++)		// scan for previous unit
		{
			if (units[k].NextUnit == iUnit)
			{
				units[k].NextUnit = units[iUnit].NextUnit;
				SetGameData(MP_UNITS, MPUNITS_NEXTUNIT, k, units[k].NextUnit, fSend );
				break;
			}
		}
	}
	// add this unit into the new province troop list
	SetGameData(MP_UNITS, MPUNITS_PROVINCE, 	iUnit, prov, FALSE );
	// Stop the unit from moving.
	SetGameData(MP_UNITS, MPUNITS_MOVING,		iUnit, FALSE, FALSE );
	SetGameData(MP_UNITS, MPUNITS_DESTPROVINCE, iUnit, NO_PROVINCE, FALSE );
	SetGameData(MP_UNITS, MPUNITS_MOVEPART,		iUnit, 0, FALSE );
	SetGameData(MP_UNITS, MPUNITS_DESTPATH1,   	iUnit, 0, FALSE);
	SetGameData(MP_UNITS, MPUNITS_DESTPATH2,   	iUnit, 0, FALSE);
	SetGameData(MP_UNITS, MPUNITS_DESTPATH3,   	iUnit, 0, FALSE);
	
	// Search for others in this provice and spot them if appropriate.
	if (units[iUnit].Icon == A_SCT_UNIT_ICON)
	{
		PROVINCE	thisProv = prov;
		PROVINCE	nextProv;
		LONG		k;
		
		if(CanISeeAnyoneInThisProv(HomeRealm, thisProv))
		{
			MarkUnitsSpotted(nextProv);
		}
		
		for(k=0;k<7;k++)
		{
			nextProv = (PROVINCE)province[thisProv].Border[k].Province;
			if(CanISeeAnyoneInThisProv(HomeRealm, nextProv))
			{
				MarkUnitsSpotted(nextProv);
			}
		}
	}
	else
	if (CanISeeAnyoneInThisProv(HomeRealm, prov))
	{
		MarkUnitsSpotted(prov);
	}
			
	
	if(!JoinUnitToOthersInProvince(iUnit, prov, fSend))
	{
		// Couldn't join up so iUnit is its own stack.
		SetGameData(MP_UNITS, MPUNITS_JOINED, iUnit, 0, FALSE );
		SetGameData(MP_UNITS, MPUNITS_NEXTUNIT, iUnit, -1, FALSE );
	}
	
	// Now send the full iUnit changes.
	#ifdef _WINDOWS
	if (fSend && IsMultiPlayer())
		AMultiPlayer.UnitMessage(iUnit, (UBYTE *)&units[iUnit], "TRANSPORT");
	#endif
}

/* ========================================================================
   Function    - MakeUnitSingleStack
   Description - Make this unit a stack unto itself.
   Returns     - The next unit after this one.
   ======================================================================== */

LONG MakeUnitSingleStack(LONG iUnit, BOOL fSend)
{
	LONG k = units[iUnit].NextUnit;
	if (units[iUnit].Joined)	// Am I a follower?
	{
	    LONG i;
	    // Find the unit who has me as the next in line.
	    for (i = 1; i < MAX_UNITS; ++i)
	    {
	       if (units[i].NextUnit == iUnit)
	       {
		       // Rejoint the list.
		       SetGameData(MP_UNITS, MPUNITS_NEXTUNIT,i,units[iUnit].NextUnit,fSend);
		       break;
	       }
	    }
	    // Since I wasn't the leader of my stack, I need to get his data
	    // and update mine.
	    LONG iUnitLeader = GetUnitLeader(iUnit);
	    if (iUnitLeader != iUnit)
	    {
		    SetGameData(MP_UNITS, MPUNITS_PROVINCE,    iUnit, units[iUnitLeader].province, FALSE);
			SetGameData(MP_UNITS, MPUNITS_NOTSPOTTED,  iUnit, units[iUnitLeader].NotSpotted, FALSE );
			SetGameData(MP_UNITS, MPUNITS_REALM,       iUnit, units[iUnitLeader].Realm, FALSE );
			SetGameData(MP_UNITS, MPUNITS_DISGUISED,   iUnit, units[iUnitLeader].Disguised, FALSE );
	    }
	}
	else
	{
	    // do I have a unit following me?
	    if (k > 0)
		{
			SetGameData(MP_UNITS, MPUNITS_JOINED,      k, FALSE, FALSE);
			SetGameData(MP_UNITS, MPUNITS_NOTSPOTTED,  k, units[iUnit].NotSpotted, FALSE );
			SetGameData(MP_UNITS, MPUNITS_PROVINCE,    k, units[iUnit].province, FALSE );
			SetGameData(MP_UNITS, MPUNITS_REALM,       k, units[iUnit].Realm, FALSE );
			SetGameData(MP_UNITS, MPUNITS_DISGUISED,   k, units[iUnit].Disguised, FALSE );
			SetGameData(MP_UNITS, MPUNITS_MOVING,      k, units[iUnit].Moving, FALSE );
			SetGameData(MP_UNITS, MPUNITS_AVOIDMOVE,   k, units[iUnit].AvoidMove, FALSE );
			SetGameData(MP_UNITS, MPUNITS_MOVEPART,    k, units[iUnit].MovePart, FALSE );
			SetGameData(MP_UNITS, MPUNITS_DESTPROVINCE,k, units[iUnit].DestProvince, FALSE);
			SetGameData(MP_UNITS, MPUNITS_DESTPATH1,   k, units[iUnit].DestPath1, FALSE);
			SetGameData(MP_UNITS, MPUNITS_DESTPATH2,   k, units[iUnit].DestPath2, FALSE);
			SetGameData(MP_UNITS, MPUNITS_DESTPATH3,   k, units[iUnit].DestPath3, FALSE);
			
			// Now send the full unit changes.
			#ifdef _WINDOWS
			if (fSend && IsMultiPlayer())
				AMultiPlayer.UnitMessage(k, (UBYTE *)&units[k], "MAKE STACK");
			#endif
			
			k = CheckLeader(k, fSend);
		}
	}
    // Disconnect me from the list.
	SetGameData(MP_UNITS, MPUNITS_JOINED,  		iUnit, FALSE, FALSE);
    SetGameData(MP_UNITS, MPUNITS_NEXTUNIT,		iUnit,-1,FALSE);
	// Stop the unit from moving.
	SetGameData(MP_UNITS, MPUNITS_MOVING,		iUnit, FALSE, FALSE );
	SetGameData(MP_UNITS, MPUNITS_DESTPROVINCE, iUnit, NO_PROVINCE, FALSE );
	SetGameData(MP_UNITS, MPUNITS_MOVEPART,		iUnit, 0, FALSE );
	SetGameData(MP_UNITS, MPUNITS_DESTPATH1,   	iUnit, 0, FALSE);
	SetGameData(MP_UNITS, MPUNITS_DESTPATH2,   	iUnit, 0, FALSE);
	SetGameData(MP_UNITS, MPUNITS_DESTPATH3,   	iUnit, 0, FALSE);
	
	// Now send the full unit changes.
	#ifdef _WINDOWS
	if (fSend && IsMultiPlayer())
		AMultiPlayer.UnitMessage(iUnit, (UBYTE *)&units[iUnit], "MAKE STACK2");
	#endif
	
	return k;
}
/* ========================================================================
   Function    - JoinUnitToOthersInProvice
   Description - Join this unit with any other same realm stack in this province.
   Returns     - TRUE or FALSE (For if joined.)
   ======================================================================== */

BOOL JoinUnitToOthersInProvince(LONG iUnit, PROVINCE prov, BOOL fSend)
{
	LONG k;
	BOOL Result = FALSE;
	
	for(k = 1; k<MAX_UNITS; ++k)
	{
		 // find the leader in the province who has the same Realm
		if(k != iUnit 
		   && units[k].province == prov 
		   && units[k].Joined == 0 
		   && units[k].Realm == units[iUnit].Realm
		   && units[k].DestProvince == NO_PROVINCE)		// Not moving
		{
			LONG i;
			LONG count = 1;
			
			for(i = k; units[i].NextUnit > 0; i = units[i].NextUnit)
			{
				++count;
			}
			if (count < gUnitStackSize)
			{
				// i has the index of the last unit in the joined troops
				// the units is less then 15 and the value of the new unit is greater than the old leader
				if(CalcUnitValues(iUnit) > CalcUnitValues(k))
				{
					// iUnit is now the head of the list.
					SetGameData(MP_UNITS, MPUNITS_NEXTUNIT, iUnit, k, fSend );
					SetGameData(MP_UNITS, MPUNITS_JOINED, iUnit, 0, FALSE );
					SetGameData(MP_UNITS, MPUNITS_JOINED, k, 1, fSend );
					Result = TRUE;
					break;
				}
				else
				{
					// if the value of the old unit is lower than the old leader.
					// iUnit is now last in the list.
					SetGameData(MP_UNITS, MPUNITS_NEXTUNIT, iUnit, -1, fSend );
					SetGameData(MP_UNITS, MPUNITS_NEXTUNIT, i, iUnit, fSend );
					SetGameData(MP_UNITS, MPUNITS_JOINED, iUnit, 1, FALSE );
					Result = TRUE;
					break;
				}
			}
		}
	}
	if (units[iUnit].Joined == TRUE)
	{
		// We are not the leader, our province doesn't matter.
		if (units[iUnit].province != NO_PROVINCE)
		{
			SetGameData(MP_UNITS, MPUNITS_PROVINCE, iUnit, NO_PROVINCE, fSend);
		}
	}
	else
	{
		if (units[iUnit].province != prov)
		{
			// We are the leader of the stack, our province must be correct.
			// the province.
			SetGameData(MP_UNITS, MPUNITS_PROVINCE, iUnit, prov, fSend);
		}
	}
	
	if (Result == TRUE)	// We joined a stack.
	{
		if (units[k].NotSpotted == FALSE)
		{
			// If the stack I joined is spotted, so am I.
			units[iUnit].NotSpotted = FALSE;
		}
		else if (units[iUnit].NotSpotted == FALSE &&
		         units[k].NotSpotted == TRUE)
		{
			// If I am spotted then the stack I join is also spotted.
			LONG iNextUnit;
			for (iNextUnit = k; iNextUnit > -1; iNextUnit = units[iNextUnit].NextUnit)
			{
				units[iNextUnit].NotSpotted = FALSE;
			}
		}
	}
	return Result;
}
/* ========================================================================
   Function    - GetUnitLeader
   Description - Get the Leader of the stack this unit currently is in.
   Returns     - The province
   ======================================================================== */

LONG GetUnitLeader(LONG iUnit)
{
	LONG TheLeader = iUnit;
	
	if (units[iUnit].Joined == TRUE )
	{
		LONG Found = FALSE;
		
		// Search within the units for the leaders of the stacks
		for (LONG k = 1; k < MAX_UNITS && !Found; ++k)
		{
			if ( units[k].Joined == FALSE
				&& units[k].province != NO_PROVINCE
			   )
			{
				// Search within the stacks for this unit.
				for (LONG j = k; j != -1; j = units[j].NextUnit)
				{
					if (j == iUnit)
					{
						Found = TRUE;
						// This unit is at the province of its leader.
						TheLeader = k;
						break;
					}
				}
			}
		}
	}
	// Else We're the leader of our stack, therefore the province data is good.
	
	return TheLeader;
}

/* ========================================================================
   Function    - CountUnitStack
   Description - Count the number of units in this stack.
   Returns     - 
   ======================================================================== */

LONG CountUnitStack(LONG iUnit)
{
	LONG i;
	LONG NumberOfUnits = 0;
	
	for (i = iUnit; i > 0; i = units[i].NextUnit)
	{
		++NumberOfUnits;
	}
	
	return NumberOfUnits;
}

/* ========================================================================
   Function    - CanISeeAnyoneInThisProv
   Description - Look and see if any unit in this province is mine or
                 my vassal's.
   Returns     - 
   ======================================================================== */
BOOL CanISeeAnyoneInThisProv(REALM::REALM_TYPE Realm, PROVINCE prov)
{
	BOOL Result = FALSE;
	LONG i;
	for (i = 1; i < MAX_UNITS; ++i)
	{
		if (units[i].Joined == FALSE
		    && units[i].province == prov
		    && (units[i].Realm == Realm
		        || ISVASSAL(units[i].Realm,Realm) 	// Vassals will alert me to these troops.
		        || ISVASSAL(Realm, units[i].Realm))	
		    )
		    {
				// I or my vassals have troops in this province.
				Result = TRUE;
				break;
		    }
	}
	if (i >= MAX_UNITS)
	{
		// No one of my or my vassal's troops are in this province.
		Result = FALSE;
	}
	
	return Result;
}
/* ========================================================================
   Function    - MarkUnitsSpotted
   Description - Mark all the units in this province as spotted.
   Returns     - 
   ======================================================================== */
void MarkUnitsSpotted(PROVINCE prov)
{
// ONLY CHANGE LOCAL - ONLY CHANGE LOCAL - ONLY CHANGE LOCAL ARRAYS
// DONT TRANSMIT TO OTHER PLAYERS - DONT TRANSMIT TO OTHER PLAYERS
	for (LONG l=1; l<MAX_UNITS; ++l)		// scan for units here
	{
		if (units[l].Joined == FALSE 
		    && units[l].province==prov )
		{
			units[l].NotSpotted = FALSE;
			// Mark all the followers as spotted too.
			for (LONG p = units[l].NextUnit;
			     p > -1;
			     p = units[p].NextUnit)
			{
				units[p].NotSpotted = FALSE;
			}
		}
	}
}

